children.text:
body { margin: 16px; font-family: Arial, sans-serif; }
table { 
  border-collapse: separate; 
  border-spacing: 0; 
  margin-bottom: 40px;
}
th, td { 
  padding: 8px 12px; 
  border: 1px solid #666; 
  background: #fff; 
}
thead th { background: #f0f0f0; }

caption { 
  font-weight: bold; 
  margin-bottom: 8px; 
  padding: 8px;
  background: #e6f3ff;
  border: 1px solid #ccc;
}

.caption-top { caption-side: top; }
.caption-bottom { caption-side: bottom; }

.styled-caption {
  font-size: 1.2em;
  color: #333;
  text-align: left;
  background: linear-gradient(to right, #f0f8ff, #e6f3ff);
}
